import * as actions from "../actionTypes";

const initalState = {
  modelType: {
    isOpen: false
  }
};


export const modelReducer = (state = initalState, action) => {
  switch (action.type) {
    case actions.SET_MODEL_TYPE:
      return {
        ...state, modelType: action.payload, isOpen: false
      };
    default:
      return state;
  }
};
